import React, { useState } from 'react'
import '../Style/style.css'

const IdFilter = () => {

    const [twitchTextArea, setTwitchTextArea] = useState([]);
    const [youtubeTextArea, setYoutubeTextArea] = useState([]);

    const onChangeTwitchTextArea = (e) => {
        const textArea_value = e.target.value;
        const arrValue = textArea_value.split(/\r?\n/);

        setTwitchTextArea(arrValue);
    }

    const onChangeYoutubeTextArea = (e) => {
        const textArea_value = e.target.value;
        const arrValue = textArea_value.split(/\r?\n\r?\n/);

        setYoutubeTextArea(arrValue);
    }

    return (
        <div id="id_filter">
            <div>
                <label>검색어:</label>
                <input type='text' />
            </div>

            <div>
                <p>Twitch Chatting</p>
                <textarea onChange={onChangeYoutubeTextArea}/>
            </div>

            <div>
                <p>Youtube Chatting</p>
                <textarea onChange={onChangeYoutubeTextArea}/>
            </div>

            <div>
                {
                    twitchTextArea.map((data) => {
                        console.log(data)
                    })
                }
            </div>
        </div>
    );
}

export default IdFilter;
